package org.babinkuk.lineparser.generic.staticformat;

public class RecordUnrecognizedException extends ParseException {
	
	/**
	 * 
	 */
	private static final long serialVersionUID = 1L;
	
	public RecordUnrecognizedException() {
		// TODO Auto-generated constructor stub
	}
	
	public RecordUnrecognizedException(String message) {
		super(message);
	}
	
	public RecordUnrecognizedException(Throwable cause) {
		super(cause);
	}
	
	public RecordUnrecognizedException(String message, Throwable cause) {
		super(message, cause);
	}

}
